import{_ as a,c as s,o as n,ak as l}from"./chunks/framework.CYxz2ou1.js";const b=JSON.parse('{"title":"MyBatis-Plus 条件查询总结","description":"","frontmatter":{},"headers":[],"relativePath":"notes/frontend/preview/backend/Java/Mybatis/MyBatis-Plus 条件查询总结.md","filePath":"notes/frontend/preview/backend/Java/Mybatis/MyBatis-Plus 条件查询总结.md","lastUpdated":1764788752000}'),t={name:"notes/frontend/preview/backend/Java/Mybatis/MyBatis-Plus 条件查询总结.md"};function r(p,e,o,i,d,c){return n(),s("div",null,[...e[0]||(e[0]=[l('<h1 id="mybatis-plus-条件查询总结" tabindex="-1">MyBatis-Plus 条件查询总结 <a class="header-anchor" href="#mybatis-plus-条件查询总结" aria-label="Permalink to &quot;MyBatis-Plus 条件查询总结&quot;">​</a></h1><h1 id="mybatis-plus-条件查询总结-1" tabindex="-1">MyBatis-Plus 条件查询总结 <a class="header-anchor" href="#mybatis-plus-条件查询总结-1" aria-label="Permalink to &quot;MyBatis-Plus 条件查询总结&quot;">​</a></h1><h2 id="_1-引言" tabindex="-1">1. 引言 <a class="header-anchor" href="#_1-引言" aria-label="Permalink to &quot;1. 引言&quot;">​</a></h2><p>MyBatis-Plus 提供了强大的条件构造器（Wrapper），旨在简化数据库操作。它允许开发者以<strong>链式调用</strong>的方式构建复杂的 SQL 条件，无需手动编写繁琐的 SQL 语句，从而提高开发效率并减少 SQL 注入的风险。</p><h2 id="_2-核心-wrapper-类" tabindex="-1">2. 核心 Wrapper 类 <a class="header-anchor" href="#_2-核心-wrapper-类" aria-label="Permalink to &quot;2. 核心 Wrapper 类&quot;">​</a></h2><p>MyBatis-Plus 的 Wrapper 类是构建查询和更新条件的核心工具，主要包括：</p><ul><li>​<strong>​</strong>​<strong>​<code>QueryWrapper</code>​</strong>​<strong>​</strong>​: 用于构造查询条件，支持各类基础操作（如等于、不等于、大于、小于）及 <code>AND</code>​、<code>OR</code> 逻辑组合。</li><li>​<strong>​</strong>​<strong>​<code>UpdateWrapper</code>​</strong>​<strong>​</strong>: 用于构造更新条件，可直接设置更新字段和条件，无需实体对象。</li><li>​<strong>​</strong>​<strong>​<code>LambdaQueryWrapper</code>​</strong>​<strong>​</strong>: 基于 Lambda 表达式的查询条件构造器，通过引用实体属性避免硬编码字段名，提高可读性。</li><li>​<strong>​</strong>​<strong>​<code>LambdaUpdateWrapper</code>​</strong>​<strong>​</strong>​: 类似于 <code>LambdaQueryWrapper</code>，用于更新操作的 Lambda 表达式条件构造器。</li><li>​<strong>​</strong>​<strong>​<code>AbstractWrapper</code>​</strong>​<strong>​</strong>: 所有 Wrapper 类的抽象基类，定义了条件构造的基本逻辑。</li></ul><h2 id="_3-通用使用提示与注意事项" tabindex="-1">3. 通用使用提示与注意事项 <a class="header-anchor" href="#_3-通用使用提示与注意事项" aria-label="Permalink to &quot;3. 通用使用提示与注意事项&quot;">​</a></h2><ul><li><strong>链式调用</strong>: 所有 Wrapper 方法均支持链式调用，方便连续构建条件。</li><li><strong>条件判断</strong>: 大部分 Wrapper 方法接受一个 <code>boolean</code> 参数，用于动态决定是否将该条件加入 SQL。</li><li><strong>字段引用</strong>: 普通 Wrapper 使用数据库字段名（<code>String</code>​），Lambda Wrapper 使用 Lambda 表达式引用实体属性（<code>Entity::getProperty</code>）。</li><li><strong>安全性</strong>: 避免直接拼接前端传入的 SQL 片段，以防 SQL 注入。MyBatis-Plus 提供了安全的参数绑定方式。</li><li><strong>线程安全性</strong>: Wrapper 实例不是线程安全的，建议每次使用时创建新实例。</li></ul><h2 id="_4-常用条件查询方法串联使用" tabindex="-1">4. 常用条件查询方法串联使用 <a class="header-anchor" href="#_4-常用条件查询方法串联使用" aria-label="Permalink to &quot;4. 常用条件查询方法串联使用&quot;">​</a></h2><p>以下是 MyBatis-Plus Wrapper 中常用条件查询方法的简要说明及串联使用示例：</p><h3 id="_4-1-相等与不等-eq​-ne​-alleq" tabindex="-1">4.1. 相等与不等 (<code>eq</code>​, <code>ne</code>​, <code>allEq</code>) <a class="header-anchor" href="#_4-1-相等与不等-eq​-ne​-alleq" aria-label="Permalink to &quot;4.1. 相等与不等 (`eq`​, `ne`​, `allEq`)&quot;">​</a></h3><ul><li><p><strong>描述</strong>: 设置字段等于 (<code>eq</code>​) 或不等于 (<code>ne</code>​) 某个值。<code>allEq</code> 可通过 Map 设置多个相等条件。</p></li><li><p><strong>示例</strong>:</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>QueryWrapper&lt;User&gt; queryWrapper = new QueryWrapper&lt;&gt;();</span></span>\n<span class="line"><span>queryWrapper.eq(&quot;id&quot;, 1) // id = 1</span></span>\n<span class="line"><span>            .ne(&quot;status&quot;, &quot;deleted&quot;) // status != &#39;deleted&#39;</span></span>\n<span class="line"><span>            .allEq(Map.of(&quot;age&quot;, 25, &quot;gender&quot;, &quot;male&quot;)); // age = 25 AND gender = &#39;male&#39;</span></span>\n<span class="line"><span>// SQL: WHERE id = 1 AND status &lt;&gt; &#39;deleted&#39; AND age = 25 AND gender = &#39;male&#39;</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br></div></div></li></ul><h3 id="_4-2-比较操作-gt​-ge​-lt​-le" tabindex="-1">4.2. 比较操作 (<code>gt</code>​, <code>ge</code>​, <code>lt</code>​, <code>le</code>) <a class="header-anchor" href="#_4-2-比较操作-gt​-ge​-lt​-le" aria-label="Permalink to &quot;4.2. 比较操作 (`gt`​, `ge`​, `lt`​, `le`)&quot;">​</a></h3><ul><li><p><strong>描述</strong>: 设置字段大于 (<code>gt</code>​)、大于等于 (<code>ge</code>​)、小于 (<code>lt</code>​)、小于等于 (<code>le</code>) 某个值。</p></li><li><p><strong>示例</strong>:</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>LambdaQueryWrapper&lt;User&gt; lambdaQueryWrapper = new LambdaQueryWrapper&lt;&gt;();</span></span>\n<span class="line"><span>lambdaQueryWrapper.gt(User::getAge, 18) // age &gt; 18</span></span>\n<span class="line"><span>                  .le(User::getScore, 100); // score &lt;= 100</span></span>\n<span class="line"><span>// SQL: WHERE age &gt; 18 AND score &lt;= 100</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br></div></div></li></ul><h3 id="_4-3-范围查询-between​-notbetween" tabindex="-1">4.3. 范围查询 (<code>between</code>​, <code>notBetween</code>) <a class="header-anchor" href="#_4-3-范围查询-between​-notbetween" aria-label="Permalink to &quot;4.3. 范围查询 (`between`​, `notBetween`)&quot;">​</a></h3><ul><li><p><strong>描述</strong>: 设置字段值在 (<code>between</code>​) 或不在 (<code>notBetween</code>) 指定范围。</p></li><li><p><strong>示例</strong>:</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>QueryWrapper&lt;User&gt; queryWrapper = new QueryWrapper&lt;&gt;();</span></span>\n<span class="line"><span>queryWrapper.between(&quot;create_time&quot;, &quot;2023-01-01&quot;, &quot;2023-12-31&quot;) // create_time BETWEEN &#39;...&#39; AND &#39;...&#39;</span></span>\n<span class="line"><span>            .notBetween(&quot;salary&quot;, 5000, 10000); // salary NOT BETWEEN 5000 AND 10000</span></span>\n<span class="line"><span>// SQL: WHERE create_time BETWEEN &#39;2023-01-01&#39; AND &#39;2023-12-31&#39; AND salary NOT BETWEEN 5000 AND 10000</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br></div></div></li></ul><h3 id="_4-4-模糊匹配-like​-notlike​-likeleft​-likeright" tabindex="-1">4.4. 模糊匹配 (<code>like</code>​, <code>notLike</code>​, <code>likeLeft</code>​, <code>likeRight</code>) <a class="header-anchor" href="#_4-4-模糊匹配-like​-notlike​-likeleft​-likeright" aria-label="Permalink to &quot;4.4. 模糊匹配 (`like`​, `notLike`​, `likeLeft`​, `likeRight`)&quot;">​</a></h3><ul><li><p><strong>描述</strong>: 设置模糊查询条件。<code>like</code>​ (全模糊), <code>notLike</code>​ (非全模糊), <code>likeLeft</code>​ (右模糊), <code>likeRight</code> (左模糊)。</p></li><li><p><strong>示例</strong>:</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>LambdaQueryWrapper&lt;User&gt; lambdaQueryWrapper = new LambdaQueryWrapper&lt;&gt;();</span></span>\n<span class="line"><span>lambdaQueryWrapper.like(User::getName, &quot;张&quot;) // name LIKE &#39;%张%&#39;</span></span>\n<span class="line"><span>                  .likeRight(User::getEmail, &quot;test&quot;); // email LIKE &#39;test%&#39;</span></span>\n<span class="line"><span>// SQL: WHERE name LIKE &#39;%张%&#39; AND email LIKE &#39;test%&#39;</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br></div></div></li></ul><h3 id="_4-5-空值判断-isnull​-isnotnull" tabindex="-1">4.5. 空值判断 (<code>isNull</code>​, <code>isNotNull</code>) <a class="header-anchor" href="#_4-5-空值判断-isnull​-isnotnull" aria-label="Permalink to &quot;4.5. 空值判断 (`isNull`​, `isNotNull`)&quot;">​</a></h3><ul><li><p><strong>描述</strong>: 设置字段为 <code>NULL</code>​ (<code>isNull</code>​) 或不为 <code>NULL</code>​ (<code>isNotNull</code>)。</p></li><li><p><strong>示例</strong>:</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>QueryWrapper&lt;User&gt; queryWrapper = new QueryWrapper&lt;&gt;();</span></span>\n<span class="line"><span>queryWrapper.isNull(&quot;address&quot;) // address IS NULL</span></span>\n<span class="line"><span>            .isNotNull(&quot;phone&quot;); // phone IS NOT NULL</span></span>\n<span class="line"><span>// SQL: WHERE address IS NULL AND phone IS NOT NULL</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br></div></div></li></ul><h3 id="_4-6-集合包含-in​-notin" tabindex="-1">4.6. 集合包含 (<code>in</code>​, <code>notIn</code>) <a class="header-anchor" href="#_4-6-集合包含-in​-notin" aria-label="Permalink to &quot;4.6. 集合包含 (`in`​, `notIn`)&quot;">​</a></h3><ul><li><p><strong>描述</strong>: 设置字段值在 (<code>in</code>​) 或不在 (<code>notIn</code>) 给定集合中。</p></li><li><p><strong>示例</strong>:</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>LambdaQueryWrapper&lt;User&gt; lambdaQueryWrapper = new LambdaQueryWrapper&lt;&gt;();</span></span>\n<span class="line"><span>lambdaQueryWrapper.in(User::getRoleId, Arrays.asList(1, 2, 3)) // role_id IN (1, 2, 3)</span></span>\n<span class="line"><span>                  .notIn(User::getDepartmentId, 10, 20); // department_id NOT IN (10, 20)</span></span>\n<span class="line"><span>// SQL: WHERE role_id IN (1, 2, 3) AND department_id NOT IN (10, 20)</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br></div></div></li></ul><h3 id="_4-7-sql-子查询-insql​-notinsql​-eqsql​-gtsql​-gesql​-ltsql​-lesql" tabindex="-1">4.7. SQL 子查询 (<code>inSql</code>​, <code>notInSql</code>​, <code>eqSql</code>​, <code>gtSql</code>​, <code>geSql</code>​, <code>ltSql</code>​, <code>leSql</code>) <a class="header-anchor" href="#_4-7-sql-子查询-insql​-notinsql​-eqsql​-gtsql​-gesql​-ltsql​-lesql" aria-label="Permalink to &quot;4.7. SQL 子查询 (`inSql`​, `notInSql`​, `eqSql`​, `gtSql`​, `geSql`​, `ltSql`​, `leSql`)&quot;">​</a></h3><ul><li><p><strong>描述</strong>: 允许使用 SQL 子查询作为条件值。</p></li><li><p><strong>示例</strong>:</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>QueryWrapper&lt;User&gt; queryWrapper = new QueryWrapper&lt;&gt;();</span></span>\n<span class="line"><span>queryWrapper.inSql(&quot;id&quot;, &quot;select user_id from user_roles where role_id = 5&quot;) // id IN (select ...)</span></span>\n<span class="line"><span>            .gtSql(&quot;salary&quot;, &quot;select avg(salary) from employees&quot;); // salary &gt; (select ...)</span></span>\n<span class="line"><span>// SQL: WHERE id IN (select user_id from user_roles where role_id = 5) AND salary &gt; (select avg(salary) from employees)</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br></div></div></li></ul><h3 id="_4-8-逻辑组合与嵌套-or​-and​-nested" tabindex="-1">4.8. 逻辑组合与嵌套 (<code>or</code>​, <code>and</code>​, <code>nested</code>) <a class="header-anchor" href="#_4-8-逻辑组合与嵌套-or​-and​-nested" aria-label="Permalink to &quot;4.8. 逻辑组合与嵌套 (`or`​, `and`​, `nested`)&quot;">​</a></h3><ul><li><p><strong>描述</strong>:</p><ul><li>​<code>or()</code>​: 改变后续条件的连接方式为 <code>OR</code>。</li><li>​<code>and(Consumer)</code>​: 创建 <code>AND</code> 嵌套条件。</li><li>​<code>nested(Consumer)</code>: 创建独立的条件块（带括号），不带默认连接符。</li></ul></li><li><p><strong>示例</strong>:</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>QueryWrapper&lt;User&gt; queryWrapper = new QueryWrapper&lt;&gt;();</span></span>\n<span class="line"><span>queryWrapper.eq(&quot;status&quot;, &quot;active&quot;) // status = &#39;active&#39;</span></span>\n<span class="line"><span>            .and(i -&gt; i.eq(&quot;gender&quot;, &quot;female&quot;).gt(&quot;age&quot;, 25)) // AND (gender = &#39;female&#39; AND age &gt; 25)</span></span>\n<span class="line"><span>            .or() // OR</span></span>\n<span class="line"><span>            .nested(j -&gt; j.like(&quot;address&quot;, &quot;北京&quot;).ne(&quot;city&quot;, &quot;上海&quot;)); // (address LIKE &#39;%北京%&#39; AND city &lt;&gt; &#39;上海&#39;)</span></span>\n<span class="line"><span>// SQL: WHERE status = &#39;active&#39; AND (gender = &#39;female&#39; AND age &gt; 25) OR (address LIKE &#39;%北京%&#39; AND city &lt;&gt; &#39;上海&#39;)</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br></div></div></li></ul><h3 id="_4-9-排序与分组-orderbyasc​-orderbydesc​-groupby​-having" tabindex="-1">4.9. 排序与分组 (<code>orderByAsc</code>​, <code>orderByDesc</code>​, <code>groupBy</code>​, <code>having</code>) <a class="header-anchor" href="#_4-9-排序与分组-orderbyasc​-orderbydesc​-groupby​-having" aria-label="Permalink to &quot;4.9. 排序与分组 (`orderByAsc`​, `orderByDesc`​, `groupBy`​, `having`)&quot;">​</a></h3><ul><li><p><strong>描述</strong>: 设置查询结果的排序 (<code>orderByAsc</code>​/<code>Desc</code>​)、分组 (<code>groupBy</code>​) 和分组后筛选 (<code>having</code>)。</p></li><li><p><strong>示例</strong>:</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>LambdaQueryWrapper&lt;User&gt; lambdaQueryWrapper = new LambdaQueryWrapper&lt;&gt;();</span></span>\n<span class="line"><span>lambdaQueryWrapper.groupBy(User::getDepartmentId) // GROUP BY department_id</span></span>\n<span class="line"><span>                  .having(&quot;count(id) &gt; 10&quot;) // HAVING count(id) &gt; 10</span></span>\n<span class="line"><span>                  .orderByDesc(User::getCreateTime); // ORDER BY create_time DESC</span></span>\n<span class="line"><span>// SQL: GROUP BY department_id HAVING count(id) &gt; 10 ORDER BY create_time DESC</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br></div></div></li></ul><h3 id="_4-10-自定义-sql-片段-apply​-last" tabindex="-1">4.10. 自定义 SQL 片段 (<code>apply</code>​, <code>last</code>) <a class="header-anchor" href="#_4-10-自定义-sql-片段-apply​-last" aria-label="Permalink to &quot;4.10. 自定义 SQL 片段 (`apply`​, `last`)&quot;">​</a></h3><ul><li><p><strong>描述</strong>:</p><ul><li>​<code>apply</code>: 直接拼接 SQL 片段到条件中，支持参数占位符。</li><li>​<code>last</code>​: 在查询的最后添加 SQL 片段（如 <code>LIMIT</code>），只能调用一次。</li></ul></li><li><p><strong>示例</strong>:</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>QueryWrapper&lt;User&gt; queryWrapper = new QueryWrapper&lt;&gt;();</span></span>\n<span class="line"><span>queryWrapper.apply(&quot;date_format(create_time, &#39;%Y-%m&#39;) = {0}&quot;, &quot;2024-07&quot;) // date_format(...) = &#39;2024-07&#39;</span></span>\n<span class="line"><span>            .last(&quot;limit 5&quot;); // LIMIT 5</span></span>\n<span class="line"><span>// SQL: WHERE date_format(create_time, &#39;%Y-%m&#39;) = &#39;2024-07&#39; limit 5</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br></div></div></li></ul><h3 id="_4-11-更新操作-set​-setsql​-setincrby​-setdecrby" tabindex="-1">4.11. 更新操作 (<code>set</code>​, <code>setSql</code>​, <code>setIncrBy</code>​, <code>setDecrBy</code>) <a class="header-anchor" href="#_4-11-更新操作-set​-setsql​-setincrby​-setdecrby" aria-label="Permalink to &quot;4.11. 更新操作 (`set`​, `setSql`​, `setIncrBy`​, `setDecrBy`)&quot;">​</a></h3><ul><li><p><strong>描述</strong>: 用于构建更新语句的 <code>SET</code> 部分。</p></li><li><p><strong>示例</strong>:</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>UpdateWrapper&lt;User&gt; updateWrapper = new UpdateWrapper&lt;&gt;();</span></span>\n<span class="line"><span>updateWrapper.set(&quot;name&quot;, &quot;新名字&quot;) // SET name = &#39;新名字&#39;</span></span>\n<span class="line"><span>             .setSql(&quot;update_time = now()&quot;) // SET update_time = now()</span></span>\n<span class="line"><span>             .setIncrBy(User::getLoginCount, 1); // SET login_count = login_count + 1</span></span>\n<span class="line"><span>// SQL: SET name = &#39;新名字&#39;, update_time = now(), login_count = login_count + 1</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br></div></div></li></ul><h2 id="_5-总结" tabindex="-1">5. 总结 <a class="header-anchor" href="#_5-总结" aria-label="Permalink to &quot;5. 总结&quot;">​</a></h2><p>MyBatis-Plus 的 Wrapper 机制通过其丰富的链式方法，极大地简化了 Java 应用程序中的数据库条件构建。开发者可以灵活地组合使用这些方法，以清晰、安全的方式实现复杂的查询和更新逻辑。熟练掌握这些方法，将显著提升开发效率和代码质量。</p>',35)])])}const g=a(t,[["render",r]]);export{b as __pageData,g as default};
